import React, { useState, useEffect } from 'react';

const AirportTable = ({
  airports,        // List of airports fetched from API
  searchQuery,     // Filter query passed from App.js
  sortBy,          // Sort field
  sortOrder,       // Sort order (asc/desc)
  onSort,          // Callback to handle sorting
  pagination,      // Pagination data (page, limit, total)
  setPagination,   // Function to update pagination
}) => {
  const [filteredAirports, setFilteredAirports] = useState(airports);

  // Apply filter based on airport name search query
  useEffect(() => {
    let filtered = airports;
    if (searchQuery) {
      filtered = airports.filter((airport) =>
        airport.name.toLowerCase().includes(searchQuery.toLowerCase())
      );
    }
    // Reset to first page if new filter is applied
    setFilteredAirports(filtered);
    setPagination((prev) => ({ ...prev, page: 1 }));
  }, [searchQuery, airports, setPagination]);

  // Sorting logic for table columns
  const handleSort = (field) => {
    const newSortOrder = field === sortBy && sortOrder === "asc" ? "desc" : "asc";
    onSort(field, newSortOrder); // Notify parent to update sort state
  };

  // Sorting filtered data
  const sortedAirports = [...filteredAirports].sort((a, b) => {
    const fieldA = a[sortBy] || "";
    const fieldB = b[sortBy] || "";
    if (sortOrder === "asc") {
      return fieldA > fieldB ? 1 : fieldA < fieldB ? -1 : 0;
    } else {
      return fieldA < fieldB ? 1 : fieldA > fieldB ? -1 : 0;
    }
  });

  // Paginated airports for displaying the current page
  const paginatedAirports = sortedAirports.slice(
    (pagination.page - 1) * pagination.limit,
    pagination.page * pagination.limit
  );

  const totalPages = Math.ceil(filteredAirports.length / pagination.limit);

  return (
    <div>
      {/* Table */}
      <table className="w-full border">
        <thead>
          <tr>
            <th className="p-2 border cursor-pointer" onClick={() => handleSort("name")}>
              Name {sortBy === "name" && (sortOrder === "asc" ? "↑" : "↓")}
            </th>
            <th className="p-2 border cursor-pointer" onClick={() => handleSort("city")}>
              City {sortBy === "city" && (sortOrder === "asc" ? "↑" : "↓")}
            </th>
            <th className="p-2 border cursor-pointer" onClick={() => handleSort("state")}>
              State {sortBy === "state" && (sortOrder === "asc" ? "↑" : "↓")}
            </th>
            <th className="p-2 border cursor-pointer" onClick={() => handleSort("country")}>
              Country {sortBy === "country" && (sortOrder === "asc" ? "↑" : "↓")}
            </th>
            <th className="p-2 border cursor-pointer" onClick={() => handleSort("region")}>
              Region
            </th>
            <th className="p-2 border cursor-pointer" onClick={() => handleSort("elevation")}>
              Elevation {sortBy === "elevation" && (sortOrder === "asc" ? "↑" : "↓")}
            </th>
            <th className="p-2 border cursor-pointer" onClick={() => handleSort("iata")}>
              IATA {sortBy === "iata" && (sortOrder === "asc" ? "↑" : "↓")}
            </th>
            <th className="p-2 border cursor-pointer" onClick={() => handleSort("icao")}>
              ICAO {sortBy === "icao" && (sortOrder === "asc" ? "↑" : "↓")}
            </th>
            <th className="p-2 border cursor-pointer" onClick={() => handleSort("lat")}>
              Latitude {sortBy === "lat" && (sortOrder === "asc" ? "↑" : "↓")}
            </th>
            <th className="p-2 border cursor-pointer" onClick={() => handleSort("lon")}>
              Longitude {sortBy === "lon" && (sortOrder === "asc" ? "↑" : "↓")}
            </th>
            <th className="p-2 border cursor-pointer" onClick={() => handleSort("tz")}>
              Timezone {sortBy === "tz" && (sortOrder === "asc" ? "↑" : "↓")}
            </th>
          </tr>
        </thead>
        <tbody>
          {paginatedAirports.map((airport, idx) => (
            <tr key={idx} className={airport.elevation > 8000 ? "bg-red-100 font-bold" : ""}>
              <td className="p-2 border">{airport.name}</td>
              <td className="p-2 border">{airport.city}</td>
              <td className="p-2 border">{airport.state || "-"}</td>
              <td className="p-2 border">{airport.country}</td>
              <td className="p-2 border">{airport.region || "-"}</td>
              <td className="p-2 border">{airport.elevation} ft</td>
              <td className="p-2 border">{airport.iata || "-"}</td>
              <td className="p-2 border">{airport.icao || "-"}</td>
              <td className="p-2 border">{airport.lat || "-"}</td>
              <td className="p-2 border">{airport.lon || "-"}</td>
              <td className="p-2 border">{airport.tz || "-"}</td>
            </tr>
          ))}
        </tbody>
      </table>

      {/* Pagination Controls */}
      <div className="flex justify-center gap-2 mt-4">
        <button
          disabled={pagination.page === 1}
          onClick={() => setPagination((prev) => ({ ...prev, page: pagination.page - 1 }))}
          className="px-3 py-1 bg-gray-200 hover:bg-gray-300 rounded disabled:opacity-50"
        >
          Previous
        </button>
        <span className="px-3 py-1 text-sm text-gray-700">
          Page {pagination.page} of {totalPages}
        </span>
        <button
          disabled={pagination.page === totalPages}
          onClick={() => setPagination((prev) => ({ ...prev, page: pagination.page + 1 }))}
          className="px-3 py-1 bg-gray-200 hover:bg-gray-300 rounded disabled:opacity-50"
        >
          Next
        </button>
      </div>
    </div>
  );
};

export default AirportTable;
